(function () {
    var b64Data = "";
    var byteCharacters = atob(b64Data);
    var byteNumbers = new Array(byteCharacters.length);
    for (var i = 0; i < byteCharacters.length; i++) {
        byteNumbers[i] = byteCharacters.charCodeAt(i);
    }
    var byteArray = new Uint8Array(byteNumbers);
    var sampleHouse = new Blob([byteArray]);

    var width = $("#x-view").width();
    $("#x-view").height(width / 1.618033988749895);

    var viewer = new Viewer("x-view");
    viewer.background = [0, 0, 0, 0];
    viewer.on("loaded", function () {
        viewer.adaptivePerformanceOn = false;
        viewer.show(ViewType.DEFAULT);
        viewer.animations.startRotation();
    });
    viewer.load(sampleHouse);
    viewer.start();
})();


